import './Main.css';
import Header from './components/header/Header';
import {Route, Link, Router} from 'react-router-dom'
import Blog from './pages/Blog';
import Cenik from './pages/Cenik';
import Kontakt from './pages/Kontakt';
import NaseSluzby from './pages/NaseSluzby';
import Reference from './pages/Reference';
import Realizace from './pages/Realizace';
import Vizualizace from './pages/Vizualizace';
import Home from './pages/Home';
function Main() {
  return (
    <div className="App">
      <Header/>
      <Route exact path='/' component={Home} />
      <Route exact path='/blog' component={Blog} />
      <Route exact path='/cenik' component={Cenik} />
      <Route exact path='/kontakt' component={Kontakt} />
      <Route exact path='/naseSluzby' component={NaseSluzby} />
      <Route exact path='/reference' component={Reference} />
      <Route exact path='/realizace' component={Realizace} />
      <Route exact path='/vizualizace' component={Vizualizace} />
    </div>
  );
}

export default Main;
